import { Link } from "react-router-dom";
import myFrends from "../data.js/courses";
const Courses = () => {
  return (
    <>
      <h1>Frends</h1>
      {myFrends.map(frends => (
        <div key={frends.id}>
          <Link to={frends.slug} className="frendsLink">
            {myFrends.title}
          </Link>
        </div>
      ))}
    </>
  );
};

export default Courses;
